CREATE PROCEDURE NewCLient
@ClientID int,
@MobilePhone int,
@EmailAddress varchar(255),
@FirstName varchar(50),
@LastName varchar(50)
AS
BEGIN
INSERT INTO dbo.Customers(customer_id, mobile_phone, email_address, first_name, last_name)
VALUES
(@ClientID, @MobilePhone, @EmailAddress, @FirstName, @LastName)
END

GRANT EXECUTE ON OBJECT::NewCLient TO administrator

EXECUTE AS USER = 'administrator'
EXEC NewCLient 222, 123321456, 'test+222@test.com', 'Janusz', 'Biznesu'
REVERT
